css:
/* highlighting is the one intentional departure from gtk's styles */
.settings-view .package-readme {
  font-size: 1.25em;
}
.settings-view .package-readme h1 {
  font-size: 2em;
  margin-top: 1.5em;
}
.settings-view .package-readme h2 {
  font-size: 1.75em;
  margin-top: 1.5em;
}
.settings-view .package-readme h3 {
  font-size: 1.5em;
  margin-top: 1.75em;
}
.settings-view .package-readme h4 {
  font-size: 1.25em;
  margin-top: 1.25em;
}
.settings-view .package-readme h1,
.settings-view .package-readme h2,
.settings-view .package-readme h3,
.settings-view .package-readme h4 {
  color: #ffffff;
}
.settings-view .package-readme a {
  color: #638eba;
}
.settings-view .package-readme hr {
  border-color: #949796;
}
.settings-view .package-readme blockquote {
  border-left-color: #949796;
}
.settings-view .package-readme pre {
  margin-bottom: 1em;
}
.settings-view .package-readme img {
  max-width: 100%;
}
.settings-view .package-readme table {
  display: block;
  margin-bottom: 1em;
  width: 100%;
  overflow: auto;
  word-break: normal;
}
.settings-view .package-readme table th {
  font-weight: bold;
  text-align: center;
}
.settings-view .package-readme table th,
.settings-view .package-readme table td {
  padding: 6px 13px;
  border: 1px solid #1c1f1f;
}
.settings-view .package-readme table tr {
  border-top: 1px solid #1c1f1f;
  background-color: #393f3f;
}
.settings-view .package-readme table tr:nth-child(2n) {
  background-color: rgba(0, 0, 0, 0.06);
}
.settings-view .package-readme kbd {
  display: inline-block;
  padding: .3em .4em;
  font-size: .8em;
  line-height: 1;
  color: #ffffff;
  vertical-align: middle;
  background-color: #515a5a;
  border: solid 1px #1c1f1f;
  border-bottom-color: #040404;
  border-radius: 2px;
  box-shadow: inset 0 -1px 0 #040404;
}
